      signalLineHolder.push(slowD); // ----------- TALLY UP LAST SMOOTHING -------------------------------

      const sumStochD = signalLineHolder.reduce((a, b) => a + b, 0);
      let smaD = sumStochD / 3;

      if (smaD < 0) {
        smaD *= -1;
