          if (isNaN(totalCul)) {
            return
          }
          volCul += dataPull.historical[i].volume;
          if (isNaN(volCul)) {
            return
          }

        }

        const vwmaFiveTeen = totalCul / volCul;

        chartArr[num].vwmaFiveTeen = vwmaFiveTeen.toFixed(2);
