      volume = 0;

      if (dataPull.historical.length < 49) {
        chartArr[num].vwmaFifty = "No Data";
      } else {
        for (let i = 0; i <= 48; i++) {
          price = dataPull.historical[i].close;
          if (price == undefined) {
            price = 0
          }
          volume = dataPull.historical[i].volume;
          if (volume == undefined) {
            volume = 0
